import './App.css';
import React, { Component } from 'react';
import Board from './components/Board/Board';
import Moves from './components/Moves/Moves';

class App extends Component {

  constructor(){
    super();
    this.state = {
      moveHistory: []
    };
  }

  render(){
    return(
    	<div className='container'>
	    	<div className="board"> 
	    		<Board />
      		</div>
      		<div className='moves'>
      			<Moves /> 
      		</div>
      	</div> 
    );
  }


}

export default App;
